import React, { FC } from 'react';
import styles from './Contact-me.module.scss';
import {BsFacebook} from 'react-icons/bs';
import {AiFillLinkedin} from 'react-icons/ai';
import {BsWhatsapp} from 'react-icons/bs';
import {BiPhone} from 'react-icons/bi';

interface ContactMeProps {}

const ContactMe: FC<ContactMeProps> = () => (
  <div className={styles.ContactMe}>
    <div>
      <p><b>You can contact me on:</b></p>
    </div>
    <div>
    <a className={styles.ContactMe__links} target='blank' href="https://www.facebook.com/profile.php?id=100000528510399"><BsFacebook size={35}/> Facebook</a>
    </div>
    <div>
    <a className={styles.ContactMe__links} href="https://www.linkedin.com/in/tamir-elmakyes-a99618255/"><AiFillLinkedin size={35}/> LinkedIn</a>
    </div>
    <div>
      <a className={styles.ContactMe__links} href="https://api.whatsapp.com/send?phone=972543193899"><BsWhatsapp size={35}/> WhatsApp</a>
    </div>
    <div>
      <BiPhone size={35}/> +972-543-193-899
    </div>
  </div>
);

export default ContactMe;
